INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (1, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Puoi registrarti a com sia come privato che come azienda.', 'GENERAL', 'it', 'Chi pu registrarsi a com?', 'registrazione, nuovo account, account utente');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (2, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'No, la registrazione a com  completamente gratuita.', 'GENERAL', 'it', 'La registrazione prevede dei costi?', 'registrazione, nuovo account, account utente');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (3, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Certamente, basta spuntare l''apposita casella durante la registrazione; sar dunque possibile inserire il nome della tua societ e la P.iva', 'GENERAL', 'it', 'Posso registrarmi come utente professionale o come azienda?', 'aziende, partita iva, societ');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (4, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Si, riceverai notifica della fattura al tuo indirizzo email. E'' possibile inoltre consultare "Documenti e fatture" nella pagina "il mio account" per avere accesso allo storico delle tue fatture in ogni momento.', 'GENERAL', 'it', 'E'' prevista l''emissione di una fattura al termine della transazione?', 'fattura, fatturazione');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (5, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Durante l''accesso, seleziona il tasto "reimposta password" e ti verr immediatamente inoltrata una nuova password al tuo indirizzo email registrato. Segui poi le istruzioni per impostare una nuova password a tua scelta.', 'GENERAL', 'it', 'Ho dimenticato la password di accesso al sito, come posso recuperarla?', 'password, reimposta password, password smarrita');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (6, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Dal pannello "il mio account", seleziona "dati personali" e poi modifica il campo che ti interessa. Tuttavia non sar possibile modificare i dati predefiniti relativi al pagamento mentre una transazione  ancora in corso.', 'GENERAL', 'it', 'Come posso modificare i miei dati personali?', 'dati personali, modifica intestazione');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (7, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'E'' possibile effettuare e ricevere pagamenti tramite bonifico bancario o tramite account Paypal. Tuttavia l''utilizzo di Paypal prevede un costo aggiuntivo di commissione pari al 3% per i pagamenti effettuati da paesi dell''UE e del 6% per i pagamenti effettuati dal resto del mondo. ', 'GENERAL', 'it', 'Quali sono i metodi di pagamento che posso utilizzare per usufruire del vostro servizio?', 'metodo di pagamento');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (8, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'No, ma puoi utilizzare una carta di credito associata al tuo account PayPal.', 'GENERAL', 'it', 'E'' possibile pagare con carta di credito?', 'carta di credito');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (9, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Certamente: com  multilingua e attivo in tutti i paesi. Per acquisti o vendite da e verso l''estero, dove cio i rischi di truffa sono maggiori,  particolarmente raccomandato.', 'GENERAL', 'it', 'Posso utilizzare il servizio di com con partner fuori dall''Italia?', 'estero, europa');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (10, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Dopo che ti sarai registrato, vai su "il mio sicuro" e seleziona "nuova transazione" nel link a sinistra. Segui poi le istruzioni.', 'TRANSACTION', 'it', 'Come faccio ad avviare una nuova transazione?', 'nuova transazione, avvio nuova transazione');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (11, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Si, fino a un massimo di 10 transazioni simultaneamente.', 'TRANSACTION', 'it', 'E'' possibile avviare pi transazioni simultaneamente?', 'nuova transazione, avvio nuova transazione');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (12, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Non  possibile modificarla. Potrai per cancellarla fino a quando essa non sar stata accettata dal partner della transazione. Nel momento in cui egli avr accettato i tuoi termini della transazione, essi diverranno vincolanti sia per te che per l''atro partner. ', 'TRANSACTION', 'it', 'E'' possibile modificare una transazione appena avviata?', 'modifica transazione, cambia termini transazione');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (14, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Si. Dopo aver visionato i termini della transazione potrai decidere se accettare o rifiutare.', 'TRANSACTION', 'it', 'E'' possibile rifiutare una transazione aperta da un altro utente?', 'rifiutare, annullare');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (15, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Si. Avrai modo di scegliere il tuo ruolo all''avvio di ogni transazione.', 'TRANSACTION', 'it', 'E'' possibile avviare una transazione sia come acquirente che come venditore?', 'ruolo');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (16, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Si, o meglio, dovrai pagare prima che la merce venga inviata,  sul conto fiduciario di com. Il pagamento da te effettuato rester bloccato finch non avrai ricevuto e verificato l''oggetto della transazione.', 'BUYER', 'it', 'Devo pagare in anticipo il venditore?', 'pagamenti, pagamento anticipato');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (17, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Il tempo di ispezione (espresso in giorni) viene definito all''avvio di ogni transazione. Quando crei o accetti una transazione, avrai modo di verificare e eventualmente modificare il tempo di ispezione stabilito.', 'BUYER', 'it', 'Quanto tempo avr a disposizione per verificare l''oggetto che mi  stato spedito?', 'tempo di ispezione, ispezione, prova');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (18, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Certamente. Se ricevi un oggetto non conforme, avrai la possibilit di rispedirlo al venditore e ottenere il rimborso della somma da te versata o potrai aprire una contestazione. ', 'BUYER', 'it', 'La merce o il servizio che ho acquistato non  conforme a quanto indicato dal venditore. Posso chiedere un rimborso?', 'non conforme, merce rovinata, pacco rotto');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (19, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Se il periodo di ispezione dovesse scadere senza che tu abbia preso una decisione o dato riscontro, considereremo l''oggetto come correttamente ricevuto.', 'BUYER', 'it', 'Ho dimenticato di informare com della corretta/erronea ricezione dell''oggetto della transazione, cosa succede?', 'non conforme, merce rovinata, pacco rotto');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (20, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Dovrai attendere che l''acquirente riceva e verifichi l''oggetto da te spedito. Non appena l''oggetto ci risulter correttamente ricevuto e verificato, provvederemo a inoltrarti il pagamento della somma pattuita. ', 'SELLER', 'it', 'Ho spedito l''oggetto della transazione all''acquirente, cosa devo fare ora?', 'spedizione, trasferimento avvenuto, trasferimento effettuato');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (21, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Dovrai attendere il termine del periodo di ispezione. Se il periodo di ispezione dovesse scadere senza che l''acquirente abbia preso una decisione, considereremo l''oggetto come correttamente accettato e ti invieremo il pagamento.', 'SELLER', 'it', 'Cosa devo fare se, dopo aver spedito l''oggetto della transazione all''acquirente, non ricevo alcuna risposta? ', 'tempo di ispezione, periodo di ispezione, ispezione, prova');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (22, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Secondo i termini della transazione, la responsabilit dell''oggetto spedito  sempre a tuo carico. Non potremo effettuare il pagamento a tuo favore se l''oggetto non sar correttamente ricevuto dall''acquirente. Tu potrai per sempre rivolgerti per spiegazioni al corriere a cui hai affidato la spedizione. A questo proposito, consigliamo sempre di utilizzare spedizioni assicurate.', 'SELLER', 'it', 'Il corriere da me utilizzato ha smarrito l''oggetto della transazione. Come devo comportarmi? ', 'corriere');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (23, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Se l''acquirente dichiara di aver ricevuto un oggetto non conforme, avr 10 giorni per riconsegnarlo (o, in caso di domini, per avviare la procedura di restituzione). Se trascorrono 10 giorni senza che l''acquirente abbia correttamente restituito l''oggetto della transazione, lo considereremo correttamente accettato.', 'SELLER', 'it', 'Cosa devo fare se l''acquirente rifiuta l''oggetto della transazione?', 'oggetto rifiutato, non conforme');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (24, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Contattaci, provvederemo a rimborsare l''acquirente della somma versata e a chiudere la transazione.', 'SELLER', 'it', 'Ho smarrito / non sono pi in possesso dell''oggetto della transazione. Come devo comportarmi? ', 'smarrito, preso, perduto ');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (25, '2013-04-09 18:04:58', '2013-04-09 18:04:58', 'Non appena l''acquirente ci confermer la corretta ricezione dell''oggetto della transazione o, in caso di mancata risposta dall''acquirente, non appena sar terminato il periodo di ispezione, provvederemo a inoltrarti il pagamento secondo la modalit da te selezionata.', 'SELLER', 'it', 'Quando potr ricevere il pagamento?', 'ricezione del pagamento, inoltro del pagamento');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (26, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'You can sign up to com both as a private or as a company.', 'GENERAL', 'en', 'Who can sign up to com?', 'registration, sign up, new account, user account');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (27, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Yes, the registration is completely free.', 'GENERAL', 'en', 'Is the registration free?', 'registration, sign up, new account, user account');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (28, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Of course, just tick the appropriate box during the registration. It will be possible to enter your company name and VAT.', 'GENERAL', 'en', 'Can I sign up as a professional user or company?', 'companies, VAT ');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (29, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Yes, you will be notified of the invoice at your email adress. You can also check "documents and invoices" in "my account" page in order to access the history of your invoices at any time.', 'GENERAL', 'en', 'Do I get an invoice at the end of the transaction?', 'invoice');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (30, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'In the sign up page, select the button "retrieve password" and you will immediately get a new password at your provided email adress. Then follow the instructions to set up a new password.', 'GENERAL', 'en', 'I forgot my password, how can i recover it?', 'password, retrieve password, password lost');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (31, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Go to "my account" page, then select "personal details" and edit the interested fields. Please note that you will not be able to edit the default payment options while the transaction is still in progress.', 'GENERAL', 'en', 'How do I change my personal informations?', 'personal info, personal data');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (32, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'com accepts wire transfers or PayPal payments. Please note that using PayPal has an additional costs of 3% from EU countries and 6% from rest of the world of the transaction price. ', 'GENERAL', 'en', 'What forms of payment does com accept?', 'method of payment, paymenty options');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (33, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'No, but you can use your credit or debit card linked with your PayPal account.', 'GENERAL', 'en', 'Is it possible to pay with Credit Card?', 'credit card');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (34, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Of course: com is a multilanguage platform active in all countries. For purchases or sales to or from foreign countries, where the risks of fraud are higher, it''s even more recommended.', 'GENERAL', 'en', 'Can I use com with abroad partners?', 'abroad, europe');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (35, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'You need to sign up to com to start a new transaction. After the registration go to "my account", select "new transaction" and follow the instructions.', 'TRANSACTION', 'en', 'How do I start a new transaction?', 'new transaction, start a new transaction');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (36, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'Yes.', 'TRANSACTION', 'en', 'Is it possible to start more transactions simultaneously?', 'new transaction, start a new transaction');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (37, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'No, but you can delete it as long as it''s not been already accepted by your transaction''s partner. When your partner accepts your terms for the transaction, they''ll become mandatory for both parties.', 'TRANSACTION', 'en', 'Can I edit a transaction i just started?', 'modify transaction, change transaction options');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (39, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'Yes, after you have checked the terms of the transaction, you can decide whether to accept or reject.', 'TRANSACTION', 'en', 'Can I cancel a transaction from another user?', 'refuse, cancel');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (40, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'Yes, when you start a new transaction you can choose your role everytime.', 'TRANSACTION', 'en', 'Is it possible to start a transaction both as seller and buyer?', 'role, transaction role');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (41, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'Yes, but your payment will remain locked until you have received and verified the object of the transaction.', 'BUYER', 'en', 'Do I have to pay the seller in advance?', 'payments, prepayment');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (42, '2013-04-10 17:02:18', '2013-04-10 17:02:14', 'The inspection time (shown in days) is defined at the beginning of every transaction. When you create or accept a new transaction, you will be able to review or modify the inspection time.', 'BUYER', 'en', 'How much time I have to control the merchandise I just received?', 'inspection time, inspection period');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (43, '2013-04-10 17:02:18', '2013-04-10 17:02:14', 'Of course. If you receive a product wich does not comply, you will be able to send it back to the seller and obtain a complete refound. Otherwise you can open a contestation.', 'BUYER', 'en', 'The service or merchandise I have bought does not comply the terms indicated by the seller. Can i request a refound?', 'non-conforming goods damaged, broken pack');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (44, '2013-04-10 17:02:18', '2013-04-10 17:02:14', 'If the inspection time would expire without you having made a decision or given a reply, we will consider the object as correctly received.', 'BUYER', 'en', 'I forgot to inform com about the correct / incorrect reception of the transaction''s object, what will happen?', 'non-conforming goods damaged, broken pack');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (45, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'You will have to wait for the buyer to receive and check the object you shipped. As soon as we will be able to verify that the object has been correctly received, we will send you the estabilished amount of money.', 'SELLER', 'en', 'I shipped the transaction''s object to the buyer, what should i do now?', 'shipment, after the transfer, transfer completed');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (46, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'You will have to wait the end of the inspection time. If the inspection time will run out without the buyer having taken a decision, we will consider the object as correctly received.', 'SELLER', 'en', 'I shipped the transaction''s object to the buyer, but i didn''t received any answer?', 'time of inspection, inspection period, inspection and testing');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (47, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'Our policy expects that the responsability for the objects shipped is alwais charged to you. We will not be able to make you the payment if the object isn''t correctly received by the buyer. You will still be able to ask your courier for explainations. Regarding this matter, we alwais recommend you to use insured shipments.', 'SELLER', 'en', 'The courier I used has lost the transaction''s object?', 'courier, express');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (48, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'If the buyer claims to have received an item which does not comply, he will have 10 days to ship it back ("return process" for domains). After 10 days without the buyer properly returning the subject of the transaction, we will consider the object as correctly received.', 'SELLER', 'en', 'The buyer rejected the transaction''s object?', 'subject refused, non-conforming');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (49, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'Contact us, we will refund the buyer of the amount paid and close the transaction.', 'SELLER', 'en', 'I have lost / I am no longer in possession of the object of the transaction?', 'lost, lost package');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (50, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'As soon as the buyer confirms the proper reception of the transaction''s object. If the buyer will not answer in the given time, as soon as the inspection''s time will end, we will be able to forward you the payment according to the mode you selected.', 'SELLER', 'en', 'When will I receive my payment?', 'receiving payment, submission of payment');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (51, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'Puedes inscribirte en com como particular o como empresa o autnomo.', 'GENERAL', 'es', 'Quin puede inscribirse en com?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (52, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'S, el registro es completamente gratuito.', 'GENERAL', 'es', 'Es el registro gratis?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (53, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'Por supuesto, slo debes marcar la casilla correspondiente durante el registro. Podrs indicar el nombre de tu empresa y el CIF.', 'GENERAL', 'es', 'Puedo registrarme como usuario profesional o empresa?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (54, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'S, te enviaremos la factura a tu direccin de correo electrnico. Tambin puedes consultar el apartado "documentos y facturas" en el panel de control "Mi cuenta" para poder acceder al historial de tus facturas en cualquier momento.', 'GENERAL', 'es', 'Recibo una factura al final de la transaccin?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (55, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'En la pgina de registro, selecciona el botn "recuperar contrasea" y te enviaremos inmediatamente una nueva contrasea a tu direccin de correo electrnico. A continuacin, sigue las instrucciones para crear una nueva contrasea.', 'GENERAL', 'es', 'Olvid mi contrasea, cmo puedo recuperarla?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (56, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'Ve a la pgina "Mi cuenta", luego selecciona "datos personales" y edita los campos que desees cambiar. Por favor, ten en cuenta que no podr editar las opciones de pago por defecto mientras una transaccin an est en curso.', 'GENERAL', 'es', 'Cmo puedo cambiar mis datos personales?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (57, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'com acepta transferencias bancarias o pagos de PayPal. Ten en cuenta que el uso de PayPal tiene un coste adicional sobre el precio de la transaccin del 3% si el pago se realiza desde pases de la UE y de un 6% en pagos desde el resto del mundo.', 'GENERAL', 'es', 'Qu formas de pago acepta com?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (58, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'No, pero usted puede utilizar su tarjeta de crdito o de dbito vinculada a su cuenta PayPal.', 'GENERAL', 'es', 'Se puede pagar con tarjeta de crdito?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (59, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'Por supuesto: com es una plataforma multilenguaje activa en todos los pases. Es lo ms recomendable para realizar compras o ventas hacia o desde el extranjero, donde los riesgos de fraude son ms altos.', 'GENERAL', 'es', 'Puedo utilizar com con socios en el extranjero?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (60, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'Es necesario darse de alta en com para iniciar una nueva transaccin. Despus registrarte, inicia sesin y ve a "Mi cuenta", selecciona "nueva transaccin" y sigue las instrucciones.', 'TRANSACTION', 'es', 'Cmo puedo empezar una nueva transaccin?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (61, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'S.', 'TRANSACTION', 'es', 'Es posible iniciar ms transacciones de forma simultnea?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (62, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'No, pero se puede eliminar siempre y cuando no haya sido ya aceptada por la otra parte de la transaccin. Cuando la otra parte acepte los trminos de la transaccin, stos se convertirn en obligatorios para ambas partes.', 'TRANSACTION', 'es', 'Puedo editar una transaccin que acabo de empezar?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (64, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'S, despus de haber comprobado los trminos de la transaccin, puedes decidir si los aceptas o rechazas.', 'TRANSACTION', 'es', 'Puedo cancelar una transaccin de otro usuario?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (65, '2013-12-18 16:49:28', '2013-12-18 16:49:30', 'S, cuando se inicia una nueva transaccin puedes elegir tu papel a realizar durante la transaccin.', 'TRANSACTION', 'es', 'Es posible iniciar una transaccin como vendedor y comprador a la vez?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (66, '2013-12-18 17:11:09', '2013-12-18 17:11:10', 'Tendrs que esperar a que el comprador reciba y revise la mercanca que has enviado. Tan pronto como verifiquemos que el envo se ha recibido y aceptado correctamente te haremos el pago acordado.', 'SELLER', 'es', 'Envi el objeto de la transaccin al comprador, qu debo hacer ahora?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (67, '2013-12-18 17:11:09', '2013-12-18 17:11:10', 'Tendrs que esperar al final del tiempo de revisin de la mercanca. Si dicho tiempo de revisin se acabar sin que el comprador haya tomado una decisin (aceptar o rechazar), consideraremos que acepta el objeto.', 'SELLER', 'es', 'Envi el objeto de la transaccin al comprador pero no recib ninguna respuesta', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (68, '2013-12-18 17:11:09', '2013-12-18 17:11:10', 'Nuestra poltica indica que eres responsable de la objetos enviados. No podremos realizarte ningn pago el objeto no es recibido correctamente por el comprador. Todava puedes consultar a tu servicio de mensajera para que expliquen lo sucedido. Nosotros recomendamos siempre el uso de envos asegurados.', 'SELLER', 'es', 'La empresa de envo que us ha perdido el objeto de la transaccin', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (69, '2013-12-18 17:11:09', '2013-12-18 17:11:10', 'Si el comprador afirma haber recibido un artculo que no cumple con lo acordado, tendr 10 das para enviarlo de vuelta ("proceso de devolucin para dominios"). Si despus de estos 10 das el comprador no devuelve correctamente el objeto de la transaccin consideraremos que lo ha aceptado.', 'SELLER', 'es', 'El comprador rechaz objeto de la transaccin', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (70, '2013-12-18 17:11:09', '2013-12-18 17:11:10', 'Si el comprador afirma haber recibido un artculo que no cumple con lo acordado, tendr 10 das para enviarlo de vuelta ("proceso de devolucin para dominios"). Si despus de estos 10 das el comprador no devuelve correctamente el objeto de la transaccin consideraremos que lo ha aceptado.', 'SELLER', 'es', 'El comprador rechaz objeto de la transaccin', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (71, '2013-12-18 17:11:09', '2013-12-18 17:11:10', 'Ponte en contacto con nosotros, le devolveremos al comprador la cantidad pagada y cerraremos la transaccin.', 'SELLER', 'es', 'He perdido / ya no estoy en posesin del objeto de la transaccin ?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (72, '2013-12-18 17:11:09', '2013-12-18 17:11:10', 'Tan pronto como el comprador confirme la correcta recepcin del objeto de la transaccin. Tambin te haremos el pago si el comprador no responde en el tiempo indicado para inspeccionar y aceptar el objeto.', 'SELLER', 'es', 'Cundo recibir mi pago?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (73, '2013-12-18 17:18:39', '2013-12-18 17:18:38', 'S, pero tu pago permanecer bloqueado en nuestra cuenta fiduciaria hasta que hayas recibido, verificado y aceptado el objeto de la transaccin.', 'BUYER', 'es', 'Tengo que pagar al vendedor por adelantado?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (74, '2013-12-18 17:18:39', '2013-12-18 17:18:38', 'El tiempo de inspeccin (mostrado en das) se define al comienzo de cada transaccin. Al crear o aceptar una nueva transaccin, podrs revisar o modificar el tiempo de inspeccin.', 'BUYER', 'es', 'Cunto tiempo tengo para revisar la mercanca que acabo de recibir?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (75, '2013-12-18 17:18:39', '2013-12-18 17:18:38', 'Por supuesto. Si recibe un producto que no cumple con lo acordado podrs devolvrselo al vendedor y recibirs de nuevo el pago que hiciste.', 'BUYER', 'es', 'El servicio o mercanca que he comprado no se ajusta a los trminos indicados por el vendedor. Puedo solicitar una devolucin?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (76, '2013-12-18 17:18:39', '2013-12-18 17:18:38', 'Si el tiempo de revisin termina sin que hayas tomado una decisin o dado una respuesta, consideraremos que aceptas el objeto.', 'BUYER', 'es', 'Me olvid de informar a com sobre la recepcin correcta / incorrecta del objeto de la transaccin, qu pasa ahora?', null);
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (77, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Sie knnen sich als Privatperson oder Unternehmen registrieren.', 'GENERAL', 'de', 'Wer kann sich bei com registrieren?', 'registration, sign up, new account, user account');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (78, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Ja, die Registrierung bei com ist vollstndig kostenlos.', 'GENERAL', 'de', 'Ist die Registrierung kostenlos?', 'registration, sign up, new account, user account');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (79, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Natrlich, es gengt das entsprechende Feld whrend der Registrierung abzuhaken und Sie knnen den Namen Ihres Unternehmens und seine Steuernummer eingeben.', 'GENERAL', 'de', 'Kann ich mich als professioneller Benutzer oder Unternehmen registrieren?', 'companies, VAT ');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (80, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Ja, Sie erhalten die Mitteilung ber die Rechnungsausstellung per E-mail. Sie knnen auch den Link: "Zahlungen" unten Ihrem com Acount anklicken, um jederzeit Zugriff auf Ihre Rechnungen zu haben.', 'GENERAL', 'de', 'Erhalte ich eine Rechnung nach dem Transaktionsabschluss?', 'invoice');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (81, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Beim Anmelden klicken Sie bitte auf "Passwort-Zurcksetzten". Sie erhalten sofort ein neues Passwort, das wir Ihnen an Ihre registrierte E-Mai-Adresse senden. Beachten  Sie bitte die entsprechenden Anweisungen, um das Passwort erfolgreich wiederherzustellen.', 'GENERAL', 'de', 'Ich habe mein Password vergessen, wie kann ich es wiederherstellen?', 'password, retrieve password, password lost');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (82, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Auf der Seite "mein Account" whlen Sie  "persnliche Daten" und ndern Sie das gewnschte Feld. Die Daten, einschlielich der Zahlungsinformationen, der laufenden Transaktionen knnen nicht gendert werden.', 'GENERAL', 'de', 'Wie ndere  ich meine persnlichen Daten?', 'personal info, personal data');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (83, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Sie knnen Zahlungen senden und erhalten mittels Bankberweisung oder PayPal. Fr die Benutzung von PayPal bei der Einzahlungen auf dem Treuhandkonto werden Zusatzkosten fellig: 3% fr die Zahlungen aus den EU Lndern und 6% fr die Zahlugen aus dem Rest der Welt.', 'GENERAL', 'de', 'Welche Zahlungsarten kann ich verwenden, um ihren Service zu benutzen?', 'method of payment, paymenty options');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (84, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Nein, Sie knnen aber eine Kreditkarte in Verbindung mit Ihrem PayPal Konto benutzen. ', 'GENERAL', 'de', 'Kann ich mit Kreditkarte bezahlen?', 'credit card');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (85, '2013-04-10 16:52:29', '2013-04-10 16:52:28', 'Natrlich: com ist eine vielsprachige Plattform und weltweit aktiv. Wir empfehlen sie besonders fr den Ein- und Verkauf vom und ins Ausland, da die Betrugsgefahr hier grer ist.', 'GENERAL', 'de', 'Kann ich den Service von com mit auslndischen Partnern benutzen?', 'abroad, europe');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (86, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'Nach der Registrierung klicken Sie auf "mein Account" und whlen Sie den Link "neue Transaktion" auf der linken Seite. Folgen Sie bitte demnach die Anweisungen.', 'TRANSACTION', 'de', 'Wie starte ich eine neue Transaktion?', 'new transaction, start a new transaction');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (87, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'Ja, bis zu hchstens 10 Transaktionen knnen Sie gleichzeitig durchfhren.', 'TRANSACTION', 'de', 'Kann ich mehrere Transaktionen gleichzeitig starten?', 'new transaction, start a new transaction');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (88, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'Das ist nicht mglich. Sie knnen aber die Transaktion abbrechen, solange sie nicht vom Transaktionspartner besttigt wurde. Sobald die Transaktionsbedingungen von beiden Seiten besttigt wurden,  werden sie fr Sie und Ihren Partner verbindlich.', 'TRANSACTION', 'de', 'Kann ich eine gerade erst gestartete Transaktion ndern?', 'modify transaction, change transaction options');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (89, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'Ja. Nach Prfung der Transaktionsbedingungen knnen Sie entscheiden, ob Sie sie akzeptieren oder ablehnen.', 'TRANSACTION', 'de', 'Kann ich eine von einem anderen Benutzer geffnete Transaktion ablehnen?', 'refuse, cancel');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (90, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'Ja. Sie knnen Ihre Rolle beim Start einer Transaktion whlen.', 'TRANSACTION', 'de', 'Kann man eine Transaktion sowohl als Kufer als auch als Verkufer starten?', 'role, transaction role');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (91, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'Sie warten, bis der Kufer den Gegenstand erhalten und geprft hat. Sobald wir die Gewissheit haben, dass der Kufer den Gegenstand erhalten und geprft hat, werden wir Ihnen die vereinbarte Zahlung berweisen.', 'SELLER', 'de', 'Ich habe dem Kufer den Transaktionsgegenstand gesandt, was soll ich jetzt tun?', 'shipment, after the transfer, transfer completed');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (92, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'Sie mssen warten, bis die Prfzeit abgelaufen ist. Wenn die Prfzeit abgelaufen ist, ohne eine Entscheidung des Kufers, werden wir den Transaktionsgegenstand als akzeptiert ansehen und Ihnen die Zahlung senden.', 'SELLER', 'de', 'Was muss ich tun, wenn ich dem Kufer den Transaktionsgegenstand geliefert habe und keine Antwort erhalte?', 'time of inspection, inspection period, inspection and testing');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (93, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'Gem den Transaktionsbedingungen tragen Sie die Verantwortung fr den Lieferung. Wir knnen Ihnen die Zahlung erst senden, wenn der Kufer den Gegenstand erhalten hat.  Sie knnen sich aber an den Kurier wenden, dem Sie die Lieferung anvertraut haben, um Aufklrung zu verlangen. In diesem Zusammenhang empfehlen wir stets die Lieferungen zu versichern.', 'SELLER', 'de', 'Der Kurier hat den Transaktionsgegenstand verloren. Wie verhalte ich mich? ', 'courier, express');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (94, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'Wenn der Kufer erklrt, einen nicht vertragsmigen Gegenstand erhalten zu haben, hat er 10 Tage Zeit, um den beanstandeten Gegenstand wieder zurckzusenden (oder im Falle von Domains, um das Rckgabeverfahren zu starten). Wenn der Kufer innerhalb von 10 Tagen den beanstandeten Transaktionsgegenstand nicht zurcksendet,  werden wir den Gegenstand als akzeptiert ansehen.', 'SELLER', 'de', 'Was soll ich tun, wenn der Kufer den Transaktionsgegenstand ablehnt?', 'subject refused, non-conforming');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (95, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'Kontaktieren Sie uns, wir  werden dem Kufer den berwiesenen Betrag zurckerstatten und die Transaktion abschlieen.', 'SELLER', 'de', 'Ich habe den Transaktionsgegenstand verloren / er ist nicht mehr in meinem Besitz. Wie verhalte ich mich? ', 'lost, lost package');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (96, '2013-04-10 17:02:36', '2013-04-10 17:02:36', 'Sobald uns der Kufer den Erhalt des Transaktionsgegenstands besttigt, oder wenn der Kufer keinen Einspruch erhebt. Nach abgelaufener Prfzeit werden wir Ihnen die Zahlung gem den von Ihnen gewhlten Bedingungen senden.', 'SELLER', 'de', 'Wann werde ich die Zahlung erhalten?', 'receiving payment, submission of payment');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (97, '2013-04-10 16:55:33', '2013-04-10 16:55:33', 'Ja, die Zahlung wird auf das Treuhandkonto vom RA Bernhard H. Jansen berwiesen, bevor die Ware zum Versand kommt. Ihre Zahlung bleibt blockiert, bis Sie den Transaktionsgegenstand erhalten und geprft haben. ', 'BUYER', 'de', 'Muss ich den Verkufer im voraus zahlen?', 'payments, prepayment');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (98, '2013-04-10 17:02:18', '2013-04-10 17:02:14', 'Die Prfzeit (in Tagen ausgedrckt) wird beim Start jeder einzelnen Transaktion definiert. Wenn Sie eine Transaktion erstellen oder akzeptieren,  knnen Sie die festgesetzte Prfzeit auch berprfen und ndern. ', 'BUYER', 'de', 'Wieviel Zeit habe ich, um den erhaltenen Gegenstand zu prfen?', 'inspection time, inspection period');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (99, '2013-04-10 17:02:18', '2013-04-10 17:02:14', 'Natrlich. Wenn Sie einen nichtvertragsmigen Gegenstand erhalten, knnen Sie ihn dem Verkufer zurcksenden und die berwiesene Zahlung zurckerstattet bekommen, oder Sie knnen Einspruch erheben.', 'BUYER', 'de', 'Die gekaufte Ware oder der Service entspricht nicht den Angaben des Verkufers. Kann ich eine Rckerstattung verlangen?', 'non-conforming goods damaged, broken pack');
INSERT INTO sicuro.freqeuntly_asked_questions (id, created, last_modified, answer, category, language, question, tags) VALUES (100, '2013-04-10 17:02:18', '2013-04-10 17:02:14', 'Wenn die Prfzeit abgelaufen ist, ohne dass Sie eine Entscheidung getroffen oder eine Antwort gegeben haben, werden wir den Gegenstand als akzeptiert ansehen. ', 'BUYER', 'de', 'Ich habe vergessen, com den korrekten/fehlerhaften Erhalt des Transaktionsgegenstands mitzuteilen. Was passiert?', 'non-conforming goods damaged, broken pack');
